/* color */
$yellow: #FFEB60;
$purple: #A451F7;
$black: #333333;
$white: #FDFAF3;

/* Layout size */
$maxWidth: 1440px;
$maxHeight: 1024px;

/* font-size */
$fl: 23px;
$main-copy-size: 80px;

/************* width and height **************/ 
$button-width: 70px;
$button-height: 31px;

/******************* fonts *******************/
$default-font: 'Noto Serif KR', serif;
$godic-font: 'Noto Sans KR', sans-serif;
$slogan-font: "supilmyeongjo010";

@font-face {
    font-family: "supilmyeongjo010";
    src: url("../font/supilmyeongjo010.ttf") format('truetype');
}
/************ tag default setting ************/
* {
    font-family: $default-font;
    margin: 0;
    padding: 0;
    color: #333333;
}

body {
    background-color: $yellow;
    min-width: 320px;
    overflow-y: scroll;
    font-family: $default-font;
}

button {
    border-radius: 50px;
    border: 1px solid $purple;
    background-color: transparent;
    color: $purple;
    font-weight: 900;
    outline: none;

    &:hover {
        cursor: pointer;
    }
}

img {
    max-width: 100%;
    vertical-align: top;
    border-style: none;
}


/******************************************/

#nav-bar {
    * {
        font-family: $godic-font;
    }
    #nav-logo {
        position: fixed;
        top: 30px;
        left: 30px;
        width: 40px;
        height: 40px;
        background-size: 25px 25px;
        background-repeat: no-repeat;
        background-image: url("../img/subLogo.svg");
        object-fit: cover;
    }
    .btn {
        top: 35px;
        height: $button-height;
        width: $button-width;
    }
    .go.login.btn {
        position: fixed;
        right: 150px;
        cursor: pointer;
    }
    .go.fee-page.btn {
        background-color: $purple;
        color: $yellow;
        position: fixed;
        right: 30px;
        width: $button-width + 35px;
        background-repeat: no-repeat;
        cursor: pointer;
    }
}
.signup-button-box {
    display: flex;
    justify-content: center;

    .go-signup-button {
        position: fixed;
        top: 88%;
        width: 330px;
        height: 65px;
        border-radius: 50px;
        background-color: black;
        border: none;
        z-index: 10;
    }
}

#pages-container {
    max-width: 100%;
    height: auto;
}

#intro-container {
    padding-left: 50px;
    max-width: 100%;
    height: auto;
    min-height: 1300px;
    background-color: $yellow;
    .logo {
        width: 80px;
        height: 26px;
        padding-top: 110px;
        background-repeat: no-repeat;
        img {
            height: 100%;
        }
    }

    .copy-wrap {
        position: relative;
        z-index: 1;
        .main-copy {
            padding-top: 40px;
            font-size: $main-copy-size;
            font-weight: 900;
        }
        
        .sub-copy {
            position: relative;
            margin-top: 20px;
            font-size: $fl;
            strong {
                color: $purple;
            }
        }
    }
    img {
        max-width: 100%;
    }
    .imgContainer {
        position: relative;
        top: -30px;
        right: -30%;
        width: 70%;
        max-width: 967px;
        div {
            display: block;
        }
    }
    .book1-img {
        position: absolute;
        width: 5%;
        top: 23%;
        left: 36.70599900842836%;
    }
    .book2-img {
        position: absolute;
        width: 4%;
        top: 23%;
        left: 45%;
    }
}


#slogan-container {
    display: flex;
    justify-content: center;
    background-color: $yellow;
    max-width: 100%;
    min-height: 1300px;
    font-family: 'Noto Serif KR', Serif;
    .copy-and-logo-container {
        display: flex;
        margin-bottom: 200px;
        flex-direction: column;
        justify-content: space-between;
        .main-copy {
            padding-top: 130px;
            * {
                font-family: $slogan-font;
                font-size: 60px;
            }
            strong {
                font-weight: 900;
                color: $purple;
            }
        }
    }

    .shelf-image-box {
        display: flex;
        max-width: 100%;
        flex-direction: column;
        position: absolute;
        top: 190%;
        left: 70%;
        img {
            display: block;
        }
        & :nth-child(2) {
            position: absolute;
            left: -200%;
            top: 100px;
            padding-top: 70px;
        }
        & :last-child {
            position: absolute;
            right: 130px;
            top: 330px;
        }
    }    
    
    .slogan-and-logo {
        width:150px;
        height:55px;
    }
}

#book-introduction-container {
    display: block;
    min-height: 1024px;     
    padding-left: 50px;
    .book-main-copy {
        font-size: $main-copy-size;
    }
    .book-sub-copy  {
        strong {
            color: $purple;
        }
        margin-top: 20px;
        font-size: $fl;
    }
    .descriptions {
        margin-top: 30px;
        p {
            font-family: 'Noto Sans KR', sans-serif;
            font-weight: 700;
        }
        div {
            margin-top:10px;
        }
    }
    .books-img-wrap {
        position: relative;
        top: -124px;
        left: -50px;
        z-index:-1;
        opacity: 0.5;
        img {
            margin: 10px;
            width: 100px;
            min-height: 140px;
            max-height: 140px;
        }
    }
}

#genre-introduction-container {
    padding-top: 60px;
    padding-left: 50px;
    min-height: 1024px;
    background: $white;
    .genre-main-copy {
        margin-top: 15px;
        font-size: $main-copy-size;
    }
    .genre-sub-copy {
        strong {
            color: $purple;
        }
        font-size: $fl;
        margin-top: 20px;
    }
    .descriptions {
        margin-top: 30px;
    }
    .description {
        p {
            strong {
                font-family: 'Noto Sans KR', sans-serif;
                font-weight: 900;
            }
            font-family: 'Noto Sans KR', sans-serif;
            font-weight: 500;
        }
        margin-bottom: 15px;
    }
}

#contents-introduction-container {
    padding-top: 60px;
    padding-left: 50px;
    min-height: 1024px;
    background: $white;
    .contents-main-copy {
        margin-top: 15px;
        font-size: $main-copy-size;
    }
    .contents-sub-copy {
        strong {
            color: $purple;
        }
        font-size: $fl;
        margin-top: 20px;
    }
    .descriptions {
        margin-top: 30px;
    }
    .description {
        p {
            strong {
                font-family: 'Noto Sans KR', sans-serif;
                font-weight: 900;
            }
            font-family: 'Noto Sans KR', sans-serif;
            font-weight: 500;
        }
        margin-bottom: 15px;
    }
    .contents-img-box {
        margin-top: 0;
        position: absolute;
        top: 740%;
        right: 0;
        width: 60%;
        display: flex;
        flex-wrap: wrap;
        .content {
            width: 45%;
            background-repeat: no-repeat;
            background-size: contain;
            .content-first-model {
                position: absolute;
                z-index: 1;
                left: -2%;
                bottom: -8%;
                width: 40%;
            }
            .content-first-btn {
                position: absolute;
                z-index: 2;
                left: -55%;
                right: 0;
                bottom: 14%;
                margin: auto;
                width: 40%;
            }
        }
    }
}


#subscribe-option-introduction-container {
    padding-top: 60px;
    padding-left: 50px;
    min-height: 2000px;
    background: #542385;
    * {
        color: white;
    }
    .contents-main-copy {
        margin-top: 15px;
        font-size: $main-copy-size;
    }
    .contents-sub-copy {
        strong {
            color: $yellow;
        }
        font-size: $fl;
        margin-top: 20px;
    }
    .descriptions {
        margin-top: 30px;
    }
    .description {
        p {
            strong {
                font-family: 'Noto Sans KR', sans-serif;
                font-weight: 900;
            }
            font-family: 'Noto Sans KR', sans-serif;
            font-weight: 500;
        }
        margin-bottom: 15px;
    }
    .presents-wrapper {
        width: 50%;
        position: absolute;
        right: 0;
        .present {
            width: 400px;
            height: 400px;
        }
    }
    .present-box {
        width: 400px;
        height: 400px;
        display: flex;
        justify-content: center;
        position: absolute;
        top: -40%;
        .head {
            top: -60%;
            width: 255px;
            height: 128px;
            z-index: 1;
        }
        .body {
            width: 225px;
            height: 222px;
        }
    }
    .original-logo {
        position: relative;
        top: 300px;
        left: 55px;
    }
}
